import React,{useState,useEffect} from 'react';
import './App.css';
import { JsonToTable } from "react-json-to-table";
import Stopwatch from "./Stopwatch";
import "./styles.css";
import { makeStyles } from '@material-ui/core/styles';

import ReactTable from 'react-table';
import "react-table/react-table.css";

function App() {

  function createData(clicks, keystrokes, name, time) {
  return { clicks, keystrokes, name, time};
  }

  const rows = []
  const data = require('./activities.json')
  var countKey = Object.keys(data['activities']).length;


  for(var i = 0; i < countKey; i++){
    rows.push(data['activities'][i])


  }



  const columns = [{
        Header: 'Application',
        accessor: 'name'
      }, {
        Header: 'Clicks',
        accessor: 'clicks'},
        {
          Header: 'Keystrokes',
          accessor: 'keystrokes'},
          {
            Header: 'Time Spent',
            accessor: 'time_entries'},
      ];


  return (


    <ReactTable
            data={data['activities']}
            columns={columns}
            defaultPageSize={5}
            className="-striped -highlight"
          />



  );
}

export default App;
